import { useState } from "react";
import { runPrompt }from "./GPT/useGPT"

const Terminal = () => {
    const [idea, setIdea] = useState("")


    const createIdea = async () => {
        const json = await runPrompt('very hard');
        setIdea(json)
    }

    return ( 
        <div className="w-5/6 h-5/6 bg-neutral-900 rounded-3xl  border-neutral-900 border-t-8 text-white">
        <p>{idea}</p>
        <button className="absolute text-7xl" onClick={() => createIdea()}>Generate New Project Idea</button>
        </div>
     );
}

export default Terminal;
